import { Button } from '@material-ui/core'
import { AiOutlineMenu } from 'react-icons/ai'

const Appbar = () => {

    return (
        <div className="appbar">
            <Button>
                <AiOutlineMenu size="25px" />
            </Button>
        </div>
    )
}

export default Appbar
